    def __init__(self, readername):
        self.mem_pointer = PythonICA.memory
        self.selected = False
        self.dir = False
        self.ef = None
        self.reader = readername

    # noinspection PyMethodMayBeStatic
    def getupstreamconnection(self):
        """
        Creates a new upstream session for command requests
        :return:
        """
        return None

    def closeupstreamconnection(self, session):
        """
        As described in the abstract class
        :param session:
        :type session: requests.Session
        :return:
        """
        pass

    def reset(self):
        """

        :return:
        """
        self.mem_pointer = PythonICA.memory
        # self.selected = False
        self.dir = False
        return "3BDA96FF8131FE45805631B85349434181057B"  # TODO this is not correct ATR

    # TODO we should use another variable for checking if it was powered-down
    def is_reset(self):
        """

        :return:
        """
        return not self.selected

    # noinspection PyMethodMayBeStatic
    def root(self, apdu):
        result = False
        for each in PythonICA.memory:  # multiple applets, each just 1 entry point
            if apdu == each['data'][0]['item']:
                result = True
        return result

    def select_applet(self, apdu):
        for each in PythonICA.memory:  # multiple applets, each just 1 entry point
            if (apdu == each['data'][0]['item']) or (apdu + "00" == each['data'][0]['item']):
                self.selected = True
                self.mem_pointer = each
                self.selected = True
                self.mem_pointer = each['data'][0]
                break
            elif (apdu == each['item']) or (apdu + "00" == each['item']):
                self.selected = True
                self.mem_pointer = each
                break

        # and shift to the correct structure
        if self.selected:
            return self.mem_pointer['response']
        else:
            return "6AX2"

    def command(self, apdu):
        completed = False
        response = None
        if 'file' in self.mem_pointer:
            for each in self.mem_pointer['file']:  # multiple applets, each just 1 entry point
                if re.match(each['item'], apdu) or re.match(each['item'], apdu + "00"):
                    #                if apdu == each['item']:
                    response = each['response']
                    self.mem_pointer = each
                    completed = True
                    break
        if not completed and 'data' in self.mem_pointer:
            for each in self.mem_pointer['data']:
                if re.match(each['item'], apdu) or re.match(each['item'], apdu + "00"):
                    #                if apdu == each['item']:
                    response = each['response']
                    completed = True
                    break

        if completed and response:
            return response
        else:
            return "6AX3"

    def execute(self, apdu):
        """

        :param apdu:
        :type apdu: str
        :return:
        """
        apdu = ''.join(apdu.split()).upper()
        if (not self.selected) and (not self.root(apdu)):
            return '6AXX'
        if (PythonICA.memory[0]['item'] == apdu) or (PythonICA.memory[0]['item'] == apdu + "00"):
            return PythonICA.memory[0]['response']
        elif self.root(apdu):
            self.dir = True
            return self.select_applet(apdu)
        else:
            return self.command(apdu)
